ional information for Read instructions.", "$ref": "ReadInstruction" }, "flatten": { "description": "Additional information for Flatten instructions.", "$ref": "FlattenInstruction" }, "outputs": { "description": "Describes the outputs of the instruction.", "type": "array", "items": { "$ref": "InstructionOutput" } }, "originalName": { "description": "System-defined name for the operation in the original workflow graph.", "type": "string" }, "systemName": { "description": "System-defined name of this operation. Unique across the workflow.", "type": "string" }, "write": { "$ref": "WriteInstruction", "description": "Additional information for Write instructions." }, "name": { "type": "string", "description": "User-provided name of this operation." }, "partialGroupByKey": { "description": "Additional information for PartialGroupByKey instructions.", "$ref": "PartialGroupByKeyInstruction" }, "parDo": { "$ref": "ParDoInstruction", "description": "Additional information for ParDo instructions." } } }, "Source": { "id": "Source", "description": "A source that records can be read and decoded from.", "type": "object", "properties": { "baseSpecs": { "items": { "additionalProperties": { "type": "any", "description": "Properties of the object." }, "type": "object" }, "description": "While splitting, sources may specify the produced bundles as differences against another source, in order to save backend-side memory and allow bigger jobs. For details, see SourceSplitRequest. To support this use case, the full set of parameters of the source is logically obtained by taking the latest explicitly specified value of each parameter in the order: base_specs (later items win), spec (overrides anything in base_specs).", "type": "array" }, "codec": { "additionalProperties": { "type": "any", "description": "Properties of the object." }, "description": "The codec to use to decode data read from the source.", "type": "object" }, "doesNotNeedSplitting": { "type": "boolean", "description": "Sett