rs.", "$ref": "StructuredMessage" }, "time": { "description": "The time this event was emitted to indicate a new target or current num_workers value.", "format": "google-datetime", "type": "string" }, "eventType": { "type": "string", "enum": [ "TYPE_UNKNOWN", "TARGET_NUM_WORKERS_CHANGED", "CURRENT_NUM_WORKERS_CHANGED", "ACTUATION_FAILURE", "NO_CHANGE" ], "description": "The type of autoscaling event to report.", "enumDescriptions": [ "Default type for the enum. Value should never be returned.", "The TARGET_NUM_WORKERS_CHANGED type should be used when the target worker pool size has changed at the start of an actuation. An event should always be specified as TARGET_NUM_WORKERS_CHANGED if it reflects a change in the target_num_workers.", "The CURRENT_NUM_WORKERS_CHANGED type should be used when actual worker pool size has been changed, but the target_num_workers has not changed.", "The ACTUATION_FAILURE type should be used when we want to report an error to the user indicating why the current number of workers in the pool could not be changed. Displayed in the current status and history widgets.", "Used when we want to report to the user a reason why we are not currently adjusting the number of workers. Should specify both target_num_workers, current_num_workers and a decision_message." ] }, "currentNumWorkers": { "description": "The current number of workers the job has.", "type": "string", "format": "int64" } }, "id": "AutoscalingEvent", "type": "object", "description": "A structured message reporting an autoscaling decision made by the Dataflow service." }, "WorkerLifecycleEvent": { "type": "object", "id": "WorkerLifecycleEvent", "description": "A report of an event in a worker's lifecycle. The proto contains one event, because the worker is expected to asynchronously send each message immediately after the event. Due to this asynchrony, messages may arrive out of order (or missing), and it is up to the consumer to interpret. The timestamp of the event is in the en