nal lua-resty-gcp-scm-1.rockspec.template spec src upload.sh If we are processing record #30 (starting at 1) out of 50 in a perfectly splittable 50-record input, this value should be 21 (20 remaining + 1 current). LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh If we are reading through block 3 in a block-compressed file consisting of 5 blocks, this value should be 3 (since blocks 4 and 5 can be processed in parallel by new tasks via dynamic splitting and the current task remains processing block 3). LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh If we are reading through the last block in a block-compressed file, or reading or processing the last record in a perfectly splittable input, this value should be 1, because apart from the current task, no additional remainder can be split off." }, "position": { "$ref": "Position", "description": "A Position within the work to represent a progress." } } }, "DistributionUpdate": { "properties": { "max": { "$ref": "SplitInt64", "description": "The maximum value present in the distribution." }, "sum": { "$ref": "SplitInt64", "description": "Use an int64 since we'd prefer the added precision. If overflow is a common problem we can detect it and use an additional int64 or a double." }, "min": { "$ref": "SplitInt64", "description": "The minimum value present in the distribution." }, "count": { "description": "The count of the number of elements present in the distribution.", "$ref": "SplitInt64" }, "histogram": { "$ref": "Histogram", "description": "(Optional) Histogram of value counts for the distribution." }, "sumOfSquares": { "description": "Use a double since the sum of squares is likely to overflow int64.", "type": "number", "format": "double" } }, "description": "A metric value representing a distribution.", "type": "object", "id": "DistributionUpdate" }, "SDKInfo": { "id": "SDKInfo", "type": "object", "properties": { "version": { "description": "Optional. The SDK version.", "type": "string" }, "language": { "description": "Required. The SDK Language.", "type": "string", "enumDescriptions": [ "UNKNOWN Language.", "Java.", "Python." ], "enum": [ "UNKNOWN", "JAVA", "PYTHON" ] } }, "description": "SDK Information." }, "InstructionOutput": { "type": "object", "description": "An output of an instruction.", "id": "InstructionOutput", "properties": { "onlyCountKeyBytes": { "type": "boolean", "description": "For system-generated byte and mean byte metrics, certain instructions should only report the key size." }, "systemName": { "type": "string", "description": "System-defined name of this output. Unique across the workflow." }, "name": { "description": "The user-provided name of this output.", "type": "string" }, "onlyCountValueBytes": { "description": "For system-generated byte and mean byte metrics, certain instructions should only report the value size.", "type": "boolean" }, "originalName": { "type": "string", "description": "System-defined name for this output in the original workflow graph. Outputs that do not contribute to an original instruction do not set this." }, "codec": { "description": "The codec to use to encode data being written via this output.", "type": "object", "additionalProperties": { "type": "any", "description": "Properties of the object." } } } }, "StreamingComputationConfig": { "properties": { "instructions": { "type": "array", "description": "Instructions that comprise the computation.", "items": { "$ref": "ParallelInstruction" } }, "systemName": { "description": "System defined name for this computation.", "type": "string" }, "computationId": { "description": "Unique identifier for this computation.", "type": "string" }, "transformUserNameToStateFamily": { "type": "object", "description": "Map from user name of stateful transforms in